import "../../fw-cuisining.css";
import React, { useState ,useLocation, useEffect} from 'react';  // Import useState


const ProfileForm = () => {
  // Declare state for each group of checkboxes (1-3 and 4-6)
  const [selectedGroup1, setSelectedGroup1] = useState(null); // 1-3
  const [selectedGroup2, setSelectedGroup2] = useState(null); // 4-6

  // Handler for group 1 checkboxes (1-3)
  const handleGroup1Change = (id) => {
    setSelectedGroup1(id);  // Set the selected checkbox in group 1
  };

  // Handler for group 2 checkboxes (4-6)
  const handleGroup2Change = (id) => {
    setSelectedGroup2(id);  // Set the selected checkbox in group 2
  };
  const [isModalOpen, setIsModalOpen] = useState(false);

  const openModal = () => {
    setIsModalOpen(true);
  };

  const closeModal = () => {
    setIsModalOpen(false);
  };
  useEffect(() => {
      if (location.pathname === '/customize-profile') {
        openModal();
      }
    }, [location]);
  return (
    <>
      <div className="container d-flex flex-column align-items-start">
        <h1 className="align-self-start mt-5 font-weight-900">Cuisining</h1>
        <h3 className="align-self-start mt-3 ml-3 font-weight-600">Customize Profile</h3>

        <div className="d-flex align-items-center">
          <img 
            src="loloraf.png" 
            className="rounded-circle" 
            alt="Avatar" 
            style={{ width: 'auto', height: '230px', objectFit: 'cover' }}
          />
          <div className="ms-3">
            <p className="mb-1 ml-5 font-weight-500">John Manuel Cuerdo</p>
            <p className="mb-0 ml-5 font-weight-400">
              johnmanuelcuerdo@gmail.com
              <a 
                href="#verify" 
                className="verify-link ms-2 ml-2" 
                onClick={() => alert('Verification link clicked')}
              >
                Verify your Gmail address
              </a>
            </p>
          </div>
        </div>

        <div className="mt-3">
          <label htmlFor="normal-textbox">FullName</label>
          <input 
            type="text" 
            id="normal-textbox" 
            className="input-text" 
            placeholder="Enter fullname here..." 
          />
        </div>

        {/* First Group of Checkboxes (1-3) */}
        <div className="d-flex flex-column align-items-start mt-3">
          <h4 className="mt-3">Do you have any experience in cooking before?</h4>

          <div className="form-check">
            <input
              type="checkbox"
              id="customCheckbox1"
              className="checkbox"
              checked={selectedGroup1 === '1'}
              onChange={() => handleGroup1Change('1')}
            />
            <label htmlFor="customCheckbox1" className="checkbox-label">Do you have experience in cooking?</label>
          </div>

          <div className="form-check mt-3">
            <input
              type="checkbox"
              id="customCheckbox2"
              className="checkbox"
              checked={selectedGroup1 === '2'}
              onChange={() => handleGroup1Change('2')}
            />
            <label htmlFor="customCheckbox2" className="checkbox-label">I have a bit of experience in cooking</label>
          </div>

          <div className="form-check mt-3">
            <input
              type="checkbox"
              id="customCheckbox3"
              className="checkbox"
              checked={selectedGroup1 === '3'}
              onChange={() => handleGroup1Change('3')}
            />
            <label htmlFor="customCheckbox3" className="checkbox-label">I have no experience at all</label>
          </div>
        </div>

        {/* Second Group of Checkboxes (4-6) */}
        <div className="d-flex flex-column align-items-start mt-3">
          <h4 className="mt-3">Do you have any experience in cooking before?</h4>

          <div className="form-check">
            <input
              type="checkbox"
              id="customCheckbox4"
              className="checkbox"
              checked={selectedGroup2 === '4'}
              onChange={() => handleGroup2Change('4')}
            />
            <label htmlFor="customCheckbox4" className="checkbox-label">Do you have experience in cooking?</label>
          </div>

          <div className="form-check mt-3">
            <input
              type="checkbox"
              id="customCheckbox5"
              className="checkbox"
              checked={selectedGroup2 === '5'}
              onChange={() => handleGroup2Change('5')}
            />
            <label htmlFor="customCheckbox5" className="checkbox-label">I have a bit of experience in cooking</label>
          </div>

          <div className="form-check mt-3">
            <input
              type="checkbox"
              id="customCheckbox6"
              className="checkbox"
              checked={selectedGroup2 === '6'}
              onChange={() => handleGroup2Change('6')}
            />
            <label htmlFor="customCheckbox6" className="checkbox-label">I have no experience at all</label>
          </div>
        </div>

        {/* Buttons */}
        <div className="buttonContainer d-flex align-items-center mt-5 mb-5">
          <button className="cbtn cbtn-success ml-4">Submit</button>
          <button className="cbtn cbtn-outline-secondary ml-3">Cancel</button>
        </div>
      </div>
      <div>
      {/* Modal */}
      {isModalOpen && (
        <div className={`cmodal-overlay ${isModalOpen ? 'show' : ''}`}>
          <div className="cmodal">
            <div className="cmodal-header">
              <h5 className="cmodal-title">Modal Title</h5>
              <button className="cmodal-close" onClick={closeModal}>Ã—</button>
            </div>
            <div className="cmodal-body">
            <p>
              tignan mo nalang sa code
              </p>
            </div>
            <div className="cmodal-footer">
              <button className="cbtn cbtn-secondary" onClick={closeModal}>Close</button>
              <button className="cbtn cbtn-primary">Okay</button>
            </div>
          </div>
        </div>
      )}

      {/* Button to trigger modal */}
      <button className="cbtn cbtn-primary" onClick={openModal}>modal</button>
    </div>

      {/* Footer */}
      <footer className="bg-dark text-white text-center py-3">
        &copy; 2024 Your Website
      </footer>
    </>
  );
};

export default ProfileForm;
